import React from 'react';
import { Link } from 'react-router-dom';

const Error404 = () => {
	return (
		<div className="view-error-404">
			<h1>Không tìm thấy trang này</h1>
			<Link to="/">Quay lại trang chủ</Link>
		</div>
	);
};

export default Error404;
